boolean result = true;

   if (StringUtils.isAnyEmpty(
           value.getUserPassword(),
           value.getUserEmail(),
           value.getUserName(),
           value.getDescription()
   )) {
      registerViolation("Please make sure you provide non empty values for userPassword, passwordConfirm," +
              "userEmail, userName, and description (first and last name) for the new user", context);
      return false;
    }

    if (StringUtils.isEmpty(value.getUserPasswordSalt()))
      value.setUserPasswordSalt(StringUtils.SPACE);

    return result;
